If(
    Value(txtVanTransferOutCases.Text) <= ThisItem.Cases,
    If(
        !IsBlank(
            LookUp(
                transferOutProductLines,
                productId = ThisItem.'Item SKU'.'SKU Master'
            )
        ),
        Patch(
            transferOutProductLines,
            LookUp(
                transferOutProductLines,
                productId = ThisItem.'Item SKU'.'SKU Master'
            ),
            {qtyCases: Value(Self.Text)}
        );
        ,
        Collect(
            transferOutProductLines,
            {
                productId: ThisItem.'Item SKU'.'SKU Master',
                qtyCases: Value(Self.Text),
